    return (
        <div className="page-wrapper">
         <div>
            <Link to ="/managemovies">
             <Button className="manage">Manage Movies</Button> 
            </Link>
            <Link to ="/manageusers">
             <Button className="manage">Manage Users</Button> 
            </Link>
            </div>
